<li style="box-sizing: inherit; line-height: 1.875em;">Online上传逻辑重构， 行编辑模式，支持图片顺序修改</li>
<li style="box-sizing: inherit; line-height: 1.875em;">Online上传逻辑重构，在列表页面支持图片和文件的展示</li>
